(78, 1, '2019-08-15 18:20:06', '2019-08-15 15:20:06', '<!-- wp:heading -->\n<h2>Попросили привезти колонки</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Мы привезли колонки.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>А было так</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Раздался звонок, мы взяли трубку, а нам: \"Можете привезти колонки?\" На что мы: \"Да, можем\", - и привезли колонки!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>В итоге</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Акция в ювелирном магазине Адамас прошла в сопровождении наших колонок</p>\n<!-- /wp:paragraph -->', 'Акция в ювелирном магазине Адамас', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2019-08-15 18:20:06', '2019-08-15 15:20:06', '', 13, 'http://recordmusic.loc/2019/08/15/13-revision-v1/', 0, 'revision', '', 0),
